import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import AdminAddUser from "./component/dat/adminadduser/adminadduser";
import AdminLogin from "./routes/adminLogin";
import UserPage from "./component/user/userPages/userPage";
import NewFeeds from "./routes/newFeeds";
import AdminRegisterAccForUsers from "./component/dat/adminregisteraccforuser/adminregisterforuser";
import AdminBlogList from "./component/trang/admin/adminBlogList";
import AddBlog from "./component/new28_12_21/AddBlog/AddBlog";
import AdminDashBoard from "./component/admin/adminPages/adminDashboard";
import UserProfilePage from "./component/admin/adminPages/userProfilePage";
import AdvProfilePage from "./routes/advProfilePage";
import UserBlogDetail from "./component/user/userPages/userBlogDetail";
import AdminForm from "./component/admin/adminForm/adminForm";
import SchedulePage from "./component/coach/coachPages/schedulePage";
import CoachDashBoard from "./component/coach/coachPages/coachDashboard";
import CoachForm from "./component/coach/coachForm/coachForm";
import UserDashBoard from "./component/user/userForm/UserDashBoard";
import AdminRegisterAccForCoach from "./routes/adminRegisterAccForCoach";
import CoachProfilePage from "./component/coach/coachPages/coachProfilePage";
import AdminAddCoach from "./component/dat/adminaddcoach";
import CoachUserTable from "./component/dat/coachUserTable";
import CoachComment from "./component/new28_12_21/CoachComment/coachComment";
import Schedule_coach from "./component/Hung/schedule";
function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route exact path="/admin/home" element={<AdminLogin />} />
          <Route exact path="/admin/dashboard" element={<AdminDashBoard />} />
          <Route
            exact
            path="/admin/addblog"
            element={
              <AdminForm>
                <AddBlog />
              </AdminForm>
            }
          />
          <Route
            exact
            path="/admin/bloglist"
            element={
              <AdminForm>
                {" "}
                <AdminBlogList />{" "}
              </AdminForm>
            }
          />
          <Route
            exact
            path="/admin/bloglist/:id"
            element={
              <AdminForm>
                <AdvProfilePage />
              </AdminForm>
            }
          />

          <Route
            exact
            path="/admin/registeraccforuser"
            element={
              <AdminForm>
                <AdminRegisterAccForUsers />
              </AdminForm>
            }
          />
          <Route
            exact
            path="/admin/adduser"
            element={
              <AdminForm>
                <AdminAddUser />
              </AdminForm>
            }
          />
          <Route
            exact
            path="/admin/addcoach"
            element={
              <AdminForm>
                {" "}
                <AdminAddCoach />{" "}
              </AdminForm>
            }
          />

          <Route
            exact
            path="/admin/userprofile/:id"
            // element={<UserProfilePage />}
            element={
              <AdminForm>
                {" "}
                <UserProfilePage />{" "}
              </AdminForm>
            }
          />
          <Route
            exact
            path="/admin/coachprofile/:id"
            // element={<UserProfilePage />}
            element={
              <AdminForm>
                <CoachProfilePage />
              </AdminForm>
            }
          />

          <Route
            exact
            path="/admin/registeraccforcoach"
            element={
              <AdminForm>
                <AdminRegisterAccForCoach />
              </AdminForm>
            }
          />
          {/* coach */}

          <Route exact path="coach/dashboard" element={<CoachForm />}></Route>
          <Route
            exact
            path="/coach/schedule"
            element={
              <CoachForm>
                <SchedulePage />
              </CoachForm>
            }
          ></Route>
          <Route
            exact
            path="/coach/userlist"
            element={
              <CoachForm>
                <CoachUserTable />
              </CoachForm>
            }
          ></Route>
          <Route
            exact
            path="/coach/userprofile/:id"
            element={
              <CoachForm>
                <UserProfilePage>
                  <CoachComment />
                </UserProfilePage>
              </CoachForm>
            }
          />

          {/* user */}

          <Route exact path="/user/home" element={<UserPage />} />
          <Route
            exact
            path="user/dashboard"
            element={<UserDashBoard />}
          ></Route>

          <Route exact path="/user/blog" element={<NewFeeds />} />
          <Route exact path="/user/blog/:id" element={<UserBlogDetail />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
